import { createReducer, on } from '@ngrx/store';
import { loguear, desloguear } from './auth.actions';
export const usuarioLogueadoStateInicial = {};
export const authReducer = createReducer(usuarioLogueadoStateInicial, on(loguear, (state, {
  usuario
}) => {
  return Object.assign(Object.assign({}, state), {
    correoUsuario: usuario.correoUsuario
  });
}), on(desloguear, state => {
  return usuarioLogueadoStateInicial;
}));
